import React from 'react'
import Firstgrid from './Firstgrid'

function Pagecontent() {
    return (
        <>
            <div className="w3-main w3-content w3-padding" style={{ maxWidth: '1200px', marginTop: '100px' }}></div>
            <Firstgrid></Firstgrid>
        </>
    )
}

export default Pagecontent
